const startPos = rawHtml.indexOf(startMarker);
const endPos = rawHtml.indexOf(endMarker, startPos);

// If the revenue element is not found, return null
if (startPos === -1 || endPos === -1) {
    return null;
}

// Extract the revenue element
const revenueElement = rawHtml.substring(startPos + startMarker.length, endPos);

// Remove any HTML tags and whitespace from the revenue element
const revenue = revenueElement.replace(/<[^>]*>/g, '').trim();

// Return the revenue
return revenue;
"
